            // Create marker
            var marker = L.marker(new L.LatLng(row[0], row[1]), {
                icon: L.divIcon({
                    html: '<div style="' +

                          '</div>',
                    className: 'image-marker',
                    iconSize: [40, 40],

                })
            });

            // Click: open in new tab
            marker.on('click', function() {
                window.open(row[2], '_blank');
            });

            // Hover: show image preview
            marker.on('mouseover', function(e) {
                var preview = document.createElement('div');
                preview.id = 'hover-preview';
                preview.style.position = 'fixed';
                preview.style.top = (e.originalEvent.clientY + 15) + 'px';
                preview.style.left = (e.originalEvent.clientX + 15) + 'px';
                preview.style.zIndex = 10000;
                preview.style.border = '2px solid white';
                preview.style.boxShadow = '0 2px 6px rgba(0,0,0,0.3)';
                preview.style.background = 'white';
                preview.style.padding = '4px';
                preview.innerHTML = '<img src="' + row[2] + '" style="width:200px; height:auto; max-height:150px;">';
                document.body.appendChild(preview);
            });

            // Move: update position of preview
            marker.on('mousemove', function(e) {
                var preview = document.getElementById('hover-preview');
                if (preview) {
                    preview.style.top = (e.originalEvent.clientY + 15) + 'px';
                    preview.style.left = (e.originalEvent.clientX + 15) + 'px';
                }
            });

            // Mouse out: remove preview
            marker.on('mouseout', function() {
                var preview = document.getElementById('hover-preview');
                if (preview) {
                    preview.remove();
                }
            });

            return marker;
        }
